import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import SocialIcons from './SocialIcons';

function TopNav() {
  return (
    <>
      <Row style={{ backgroundColor: '#009688', paddingTop: '3.5rem', paddingBottom: '8rem' }}>
        <SocialIcons />
        <div class="col-lg-4 col-md-4 col-xs-12 text-center">
          <a href="images/jeff-berlin-resume.pdf" download="jeff-berlin-resume" alt="Download Resume PDF" title="Download Resume PDF">
            <button class="download-btn">Download My Resume</button>
          </a>
        </div>
      </Row>
    </>
  )
}

export default TopNav;
